import axios from 'axios';

function PurchaseList() {

  const handleSubmit = (e) => {
    e.preventDefault();

    const data = new FormData(e.target);

    //Su Fetch Funkcija
    // fetch('http://localhost:8000/api/products', {
    //     body: data,
    //     method: 'POST'
    // })
    // .then(resp => resp.text())
    // .then(resp => console.log(resp));

    axios.post('http://localhost:8000/api/purchases', data)
    .then(resp => {
        setMessage({m: resp.data, s: 'success'});
        // setTimeout(() => navigate('/admin'), 2000);
    })
    .catch(error => {
        setMessage({m: error.response.data, s: 'danger'})
    })
    // .finally(() => setLoading(false));
}

  return (
    <table>
      <thead>
        <td>#</td>
        <td>Purchase Date</td>
        <td>Purchase Place</td>
        <td>Payed By</td>
        <td>Offer document</td>
        <td>Purchasement document</td>
        <td>Prepayment document</td>
        <td>Final payment document</td>
        <td>invoice</td>
        <td>Other documents</td>
        <td>Purchase finished</td>
        <td>Options</td>
      </thead>
      <tbody>
        <tr>
          <td>
            New
          </td>
          <form onSubmit={handleSubmit}>
            <td>
              <input type="date" name="purchase_date"> </input>
            </td>
            <td>
              <input type="text" name="purchase_place"> </input>
            </td>
            <td>
              <input type="text" name="payment_method"> </input>
            </td>
            <td>
              <input type="text" name="offer_doc"> </input>
            </td>
            <td>
              <input type="text" name="purchase_doc"> </input>
            </td>
            <td>
              <input type="text" name="prepay_doc"> </input>
            </td>
            <td>
              <input type="text" name="final_payment_doc"> </input>
            </td>
            <td>
              <input type="text" name="invoice"> </input>
            </td>
            <td>
              <input type="text" name="other_docs"> </input>
            </td>
            <td>
              <input type="text" name="coments"> </input>
            </td>
            <td>
              <input type="text" name="finished"> </input>
            </td>
            <td>
              <button>Save</button>
            </td>
          </form>
        </tr>

      </tbody>
    </table>
  )
}

export default PurchaseList;
